	const countriesHarsh = dataCorona.reduce((map, obj) => {
		map[
			obj.name.replace(/\s+/g, '').toLowerCase()
		] = obj.Code.toLowerCase();
		return map;
	}, {});
	return (
		<div>
			<div />
